import React from 'react';

import Header from './components/Header';
import Footer from './components/Footer';

const App = () => {
  return (
    <>
      <Header />
      <main>
        <h2>Welcome to proShop</h2>
      </main>
      <Footer />
    </>
  );
};

export default App;
